import opt_paillier_c2py


class Opt_paillier_public_key(object):
    """
    Attributes:
        nbits            int    <-> ui
        lbits            int    <-> ui
        n                string <-> mpz_t
        half_n           string <-> mpz_t
        n_squared        string <-> mpz_t
        h_s              string <-> mpz_t
        fb_mod_P_sqaured dict   <-> fb_instance
        fb_mod_Q_sqaured dict   <-> fb_instance

        fb_instance
            m_mod        string <-> mpz_t
            m_table_G    list   <-> mpz_t[]
            m_h          int    <-> size_t
            m_t          int    <-> size_t
            m_w          int    <-> size_t
    """

    def __init__(self):
        pass

    def __str__(self):
        return str(self.__dict__)


